CREATE TABLE `country` (
  `id` binary(16) NOT NULL,
  `iso` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `position` int NOT NULL DEFAULT '1',
  `tax_free` tinyint(1) NOT NULL DEFAULT '0',
